ABBYY FineReader 8.0 Professional Edition is the latest version of ABBYY's
award-winning Optical Character Recognition software that delivers superior
OCR and PDF conversion capabilities. In today's world we're always short of
time - so why spend hours retyping? Use ABBYY FineReader OCR to recognize
your documents and save 14 minutes on average with each page!
ABBYY FineReader 8.0 Professional Edition is an ideal OCR application for
users who demand the highest level of recognition accuracy and format
retention. An excellent time-saving solution, FineReader OCR allows you
to convert and edit a variety of paper documents and electronic files,
including PDF files and scanned pages of books, magazines, newspapers,
legal documents, contracts, faxes, letters, brochures and much more!
ABBYY FineReader 179 languages, including English, German, French, Greek,
Spanish, Italian, Portuguese, Dutch, Swedish, Finnish, Russian, Ukrainian,
Bulgarian, Czech, Hungarian, Polish, Slovak, Malay, Indonesian, and others.
Built-in spell-check is available for 36 languages. This simplifies
document conversion for people working with a variety of different
countries and cultures.

